    <div className='phonedemo--timer'>
      <div className={selectedSection == 1 ? "phonedemo--display phonedemo--display-hidden" : "phonedemo--display"}>
      <TimerDemo /> 
      </div>
    </div>
  )
}

export default PhoneDemo
